import{_ as e,o as a,c as t,a as i}from"./app.643640af.js";var r="/aktivitaeten/BDM-2025-10/00_10-2025.jpg",n="/aktivitaeten/BDM-2025-10/01_10-2025.jpg",s="/aktivitaeten/BDM-2025-10/02_10-2025.jpg",d="/aktivitaeten/BDM-2025-10/03_10-2025.jpg",l="/aktivitaeten/BDM-2025-10/04_10-2025.jpg",o="/aktivitaeten/BDM-2025-10/05_10-2025.jpg",c="/aktivitaeten/BDM-2025-10/06_10-2025.jpg",m="/aktivitaeten/BDM-2025-10/07_10-2025.jpg",_="/aktivitaeten/BDM-2025-10/08_10-2025.jpg",p="/aktivitaeten/BDM-2025-10/09_10-2025.jpg",g="/aktivitaeten/BDM-2025-10/10_10-2025.jpg",u="/aktivitaeten/BDM-2025-10/11_10-2025.jpg",h="/aktivitaeten/BDM-2025-10/12_10-2025.jpg",B="/aktivitaeten/BDM-2025-10/13_10-2025.jpg",v="/aktivitaeten/BDM-2025-10/14_10-2025.jpg",k="/aktivitaeten/BDM-2025-10/15_10-2025.jpg",M="/aktivitaeten/BDM-2025-10/16_10-2025.jpg",D="/aktivitaeten/BDM-2025-10/17_10-2025.jpg",b="/aktivitaeten/BDM-2025-10/18_10-2025.jpg",w="/aktivitaeten/BDM-2025-10/19_10-2025.jpg",f="/aktivitaeten/BDM-2025-10/20_10-2025.jpg",j="/aktivitaeten/BDM-2025-10/21_10-2025.jpg",S="/aktivitaeten/BDM-2025-10/22_10-2025.jpg",P="/aktivitaeten/BDM-2025-10/23_10-2025.jpg",A="/aktivitaeten/BDM-2025-10/24_10-2025.jpg",T="/aktivitaeten/BDM-2025-10/25_10-2025.jpg",F="/aktivitaeten/BDM-2025-10/26_10-2025.jpg",z="/aktivitaeten/BDM-2025-10/27_10-2025.jpg",E="/aktivitaeten/BDM-2025-10/28_10-2025.jpg",H="/aktivitaeten/BDM-2025-10/29_10-2025.jpg",O="/aktivitaeten/BDM-2025-10/30_10-2025.jpg",C="/aktivitaeten/BDM-2025-10/31_10-2025.jpg";const W={},L=i('<h1 id="bilder-des-monats-oktober-2025" tabindex="-1"><a class="header-anchor" href="#bilder-des-monats-oktober-2025" aria-hidden="true">#</a> Bilder des Monats Oktober 2025</h1><p>DF7CB war auf Kundenbesuch in ZS \u{1F1FF}\u{1F1E6} kam \xFCbers Wochenende in ZA-0143 Marloth Park unter. Funkbetrieb als ZS/DF7CB war dank CEPT kein Problem. Die Drau\xDFenfunker-Vertical funktioniert auch oben auf einem Turm mit einem Astloch als Halter und da ist die Aussicht auf den Kruger National Park auch besser. Die Kudus und Zebras \u{1F993} waren direkt am Haus, die Hy\xE4nen und L\xF6wen \u{1F981} gl\xFCcklicherweise etwas weiter weg. Da wir auch Besuch von Affen \u{1F412} (und die Nachbarn von Giraffen \u{1F992}) hatten, wurde die Antenne nachts dann doch lieber immer abgebaut. QRP aus Afrika \u{1F30D} ist aber m\xFChsam, da wirklich alles immer DX ist, die nahesten QSO waren YB, PY, EA, SV, die weitesten waren K, OH, UA9 und BY.</p><p><img src="'+r+'" alt="Bilder des Monats"><img src="'+n+'" alt="Bilder des Monats"><img src="'+s+'" alt="Bilder des Monats"><img src="'+d+'" alt="Bilder des Monats"><img src="'+l+'" alt="Bilder des Monats"><img src="'+o+'" alt="Bilder des Monats"><img src="'+c+'" alt="Bilder des Monats"><img src="'+m+'" alt="Bilder des Monats"><img src="'+_+'" alt="Bilder des Monats"></p><p>Ich habe als W6/DC1TC eine schnelle Aktivierung von US-0819 Fort Point und US-7889 Presidio von San Francisco gemacht. Obwohl ich die Golden Gate Bridge schon mehrmals als Tourist besucht habe, war ich noch nie bei Fort Point unten.</p><p>Es war sehr sch\xF6nes Wetter und \xFCberschaubares St\xF6rniveau. Ich wei\xDF nicht, wie viel der H\xFCgel im Hintergrund reflektiert hat und das Salzwasser geholfen hat, aber ich habe das Gef\xFChl, dass ich ziemlich gut herausgekommen bin.</p><p><img src="'+p+'" alt="Bilder des Monats"><img src="'+g+'" alt="Bilder des Monats"><img src="'+u+'" alt="Bilder des Monats"><img src="'+h+'" alt="Bilder des Monats"></p><p>Und eine weitere Aktivierung als W6/DC1TC. Diesmal US-1161 Henry W. Coe State Park mit bequemer Picknick-Bank at Campingplatz als Aktivierungsort. Auf den Weg in den Park auch noch eine Wildtier-Sichtung.</p><p><img src="'+B+'" alt="Bilder des Monats"><img src="'+v+'" alt="Bilder des Monats"><img src="'+k+'" alt="Bilder des Monats"></p><p>Der letzte Tag auf diesem Trip als W6/DC1TC hat mich zum Feierabend-POTA an den Pazifik gebracht. US-3522 New Brighton State Beach war eine neue Referenz f\xFCr mich. Deutlich niedrigeres Noise-Level als der State Beach nebenan, nach zwei Tagen Regen ein sch\xF6ner Sonnenuntergang und ein wunderbarer Pileup. Ein wunderbarer Abschluss dieser Reise. Zu Sonnenuntergang war immer noch ein Pileup da, leider musste ich aber die Aktivierung beenden da die State Parks nach Sonnenuntergang schlie\xDFen.</p><p><img src="'+M+'" alt="Bilder des Monats"><img src="'+D+'" alt="Bilder des Monats"><img src="'+b+'" alt="Bilder des Monats"></p><p>Am 19.10.2025 um die Mittagszeit hat DB7GKA den 12 Meter Teleskopmast samt Abspannung, den TRX FT-891, die EFHW f\xFCr die B\xE4nder 40, 20, 15 und 10 Meter, den 12 Ah LiFePo-Akku und das 15 Meter lange RG-58-Koaxkabel mitsamt Mantelwellensperre eingepackt und sich auf das Fahrrad geschwungen um den POTA-Park DE-1152 Perlacher Forst und den BOTA-Bunker B/DL-0746 Perlacher Mugl zu aktivieren.</p><p>Der Teleskopmast mit der als Sloper aufgebauten EFHW hat ein paar mal interessierte Passanten angelockt und zu netten und interessanten Gespr\xE4chen gef\xFChrt. Nach dreieinhalb Stunden waren 30 QSOs gef\xFChrt in SSB auf den B\xE4ndern 40, 20 und 15 Meter im Log.</p><p><img src="'+w+'" alt="Bilder des Monats"><img src="'+f+'" alt="Bilder des Monats"><img src="'+j+'" alt="Bilder des Monats"><img src="'+S+'" alt="Bilder des Monats"><img src="'+P+'" alt="Bilder des Monats"></p><p>DL7DL - Aktivierung zweier POTA Parks in der S\xE4chsischen Schweiz in FT8, Locator JO70bx. Mit einer EFHW auf dem Hockstein und dem Blick auf Hohenstein. DE-0623 - Fernwanderweg E3 State Trail DE-0050 - S\xE4chsische Schweiz National Park</p><p><img src="'+A+'" alt="Bilder des Monats"><img src="'+T+'" alt="Bilder des Monats"><img src="'+F+'" alt="Bilder des Monats"><img src="'+z+'" alt="Bilder des Monats"><img src="'+E+'" alt="Bilder des Monats"><img src="'+H+'" alt="Bilder des Monats"><img src="'+O+'" alt="Bilder des Monats"><img src="'+C+'" alt="Bilder des Monats"></p>',15),G=[L];function N(x,K){return a(),t("div",null,G)}var U=e(W,[["render",N],["__file","2025-10-30-Bilder-Des-Monats-Oktober.html.vue"]]);export{U as default};
